'''162''' ('''one hundred [and] sixty-two''') is the [[natural number]] between [[161 (number)|161]] and [[163 (number)|163]].

== In mathematics ==
Having only 2 and 3 as its prime divisors, 162 is a [[smooth number|3-smooth number]].<ref>{{Cite OEIS|A003586|name=3-smooth numbers: numbers of the form 2^i*3^j with i, j >= 0}}.</ref> 162 is also an [[abundant number]], since its sum of divisors <math>1+2+3+6+9+18+27+54+81 = 201</math> is greater than it.<ref>{{Cite OEIS|A005101|Abundant numbers}}</ref> As the product <math>3\times 6\times 9=162</math> of numbers three units apart from each other, it is a triple factorial number.<ref>{{Cite OEIS|A007661|Triple factorial numbers}}</ref>

There are 162 ways of partitioning seven items into subsets of at least two items per subset.<ref>{{Cite OEIS|A000296|Set partitions without singletons}}</ref>

== In sports ==
*162 is the total number of [[baseball]] games each team plays during a [[Major League Baseball schedule|regular season]] in [[Major League Baseball]].<ref>{{citation|title=162-0: Imagine a Mets Perfect Season|first=Howie|last=Karpin|publisher=Triumph Books|year=2011|isbn=9781623684440}}.</ref><ref>{{citation|title=Baseball Field Guide: An In-Depth Illustrated Guide to the Complete Rules of Baseball|first1=Dan|last1=Formosa|first2=Paul|last2=Hamburger|publisher=Da Capo Press|year=2009|isbn=9780786732098|page=23|url=https://books.google.com/books?id=zI7J1vSbQB0C&pg=PA23}}.</ref>

