| number = 180
| divisor = 1, 2, 3, 4, 5, 6, 9, 10, 12, 15, 18, 20, 30, 36, 45, 60, 90, 180
}}
'''180''' ('''one hundred [and] eighty''') is the [[natural number]] following [[179 (number)|179]] and preceding [[181 (number)|181]].

==In mathematics==
180 is an [[abundant number]], with its proper divisors summing up to 366.<ref>{{cite web|title=Positive Integers: 180|url=http://www.positiveintegers.org/180}}</ref><ref name=VirtueScience>{{cite web|title=The Number 180|url=http://www.virtuescience.com/180.html|publisher=VirtueScience.com}}
</ref> 180 is also a [[highly composite number]], a positive integer with more divisors than any smaller positive integer. One of the consequences of 180 having so many divisors is that it is a [[practical number]], meaning that any positive number smaller than 180 that is not a divisor of 180 can be expressed as the sum of some of 180's divisors. 180 is a [[refactorable number]].<ref>{{Cite web|url=https://oeis.org/A033950|title=Refactorable numbers|last=|first=|date=2016-04-18|website=On-Line Encyclopedia of Integer Sequences|publisher=The OEIS Foundation|access-date=2016-04-18}}</ref>

180 is the [[Summation|sum]] of two [[square number]]s: 12<sup>2</sup> + 6<sup>2</sup>. It can be expressed as either the sum of six consecutive [[prime number]]s: [[19 (number)|19]] + [[23 (number)|23]] + [[29 (number)|29]] + [[31 (number)|31]] + [[37 (number)|37]] + [[41 (number)|41]], or the sum of eight consecutive [[prime number]]s: [[11 (number)|11]] + [[13 (number)|13]] + [[17 (number)|17]] + [[19 (number)|19]] + [[23 (number)|23]] + [[29 (number)|29]] + [[31 (number)|31]] + [[37 (number)|37]]. 180 is an [[Ulam numbers|Ulam number]], which can be expressed as a sum of earlier terms in the Ulam sequence only as 177 + 3.<ref>{{Cite web|url=https://oeis.org/A002858|title=Ulam numbers|last=|first=|date=2016-04-18|website=On-Line Encyclopedia of Integer Sequences|publisher=The OEIS Foundation|access-date=2016-04-18}}</ref>

180 is a 61-[[Polygonal number|gonal]] number.<ref name=VirtueScience/>

Half a [[circle]] has 180 degrees.<ref>{{cite book |first=D. |last=Wells|title=[[The Penguin Dictionary of Curious and Interesting Numbers]]| publisher=Penguin Group |year=1987 |location=London| page=142 |isbn=0-14-026149-4}}</ref>

Summing [[Euler's totient function]] φ(''x'') over the first + [[24 (number)|24]] integers gives 180.

180 is a [[Harshad number]] in base 10, and in [[binary numeral system|binary]] it is a digitally balanced number, since its binary representation has the same number of zeros as ones (10110100).

==In religion==
The [[Book of Genesis]] says that [[Isaac]] died at the age of 180.<ref>{{bibleverse||Genesis|35:28-29|NIV}}</ref>

==In sports==
* The maximum possible score in one turn at [[darts]] (three triple 20s).
* In [[archery]] the gent's [[Clout archery|clout]] shooting distance is 180 yards.<ref>{{cite web|title=Grand National Archery Society Rules of Shooting April 2008|url=http://www.sportfocus.com/reguser/dynabizinfo/download.cfm?number=2908|author=GNAS|year=2008}}</ref>

