'''209''' ('''two hundred [and] nine''') is the [[natural number]] following [[208 (number)|208]] and preceding [[210 (number)|210]].

==In mathematics==
*There are 209 [[spanning tree]]s in a 2&nbsp;&times;&nbsp;5 [[grid graph]],<ref>{{Cite OEIS|A001353|name=a(n) = 4*a(n-1) - a(n-2) with a(0) = 0, a(1) = 1}}</ref><ref>{{citation | last = Kreweras | first = Germain | doi = 10.1016/0095-8956(78)90021-7 | issue = 2 | journal = Journal of Combinatorial Theory | mr = 486144 | pages = 202–212 | series = Series B | title = Complexité et circuits eulériens dans les sommes tensorielles de graphes | volume = 24 | year = 1978}}</ref> 209 [[partial permutation]]s on four elements,<ref>{{Cite OEIS|A002720|name=Number of partial permutations of an n-set; number of n X n binary matrices with at most one 1 in each row and column}}</ref><ref>{{citation | last1 = Laradji | first1 = A. | last2 = Umar | first2 = A. | doi = 10.1007/s00233-007-0732-8 | issue = 1 | journal = Semigroup Forum | mr = 2351933 | pages = 221–236 | title = Combinatorial results for the symmetric inverse semigroup | volume = 75 | year = 2007}}</ref> and 209 distinct [[Graph (discrete mathematics)|undirected simple graphs]] on 7 or fewer unlabeled vertices.<ref>{{Cite OEIS|A006897|name=Hierarchical linear models on n factors allowing 2-way interactions; or graphs with <= n nodes.}}</ref><ref>{{citation | last1 = Adams | first1 = Peter | last2 = Eggleton | first2 = Roger B. | last3 = MacDougall | first3 = James A. | department = Proceedings of the Thirty-Seventh Southeastern International Conference on Combinatorics, Graph Theory and Computing | journal = Congressus Numerantium | mr = 2311249 | pages = 65–80 | title = Taxonomy of graphs of order 10 | volume = 180 | year = 2006 | url = https://people.smp.uq.edu.au/PeterAdams/research/poset10/graphsorder10.pdf}}</ref>
*209 is the smallest number with six representations as a sum of three positive squares.<ref>{{Cite OEIS|A025414|name=a(n) is the smallest number that is the sum of 3 nonzero squares in exactly n ways.}}</ref> These representations are:
*:209 {{nowrap|1== 1<sup>2</sup> + 8<sup>2</sup> + 12<sup>2</sup>}} {{nowrap|1== 2<sup>2</sup> + 3<sup>2</sup> + 14<sup>2</sup>}} {{nowrap|1== 2<sup>2</sup> + 6<sup>2</sup> + 13<sup>2</sup>}} {{nowrap|1== 3<sup>2</sup> + 10<sup>2</sup> + 10<sup>2</sup>}} {{nowrap|1== 4<sup>2</sup> + 7<sup>2</sup> + 12<sup>2</sup>}} {{nowrap|1== 8<sup>2</sup> + 8<sup>2</sup> + 9<sup>2</sup>}}.
:By [[Legendre's three-square theorem]], all numbers congruent to 1, 2, 3, 5, or 6 mod 8 have representations as sums of three squares, but this theorem does not explain the high number of such representations for 209.
*{{nowrap|1=209 = 2 &times; 3 &times; 5 &times; 7 &minus; 1}}, one less than the product of the first four prime numbers. Therefore, 209 is a [[Euclid number]] of the second kind, also called a Kummer number.<ref>{{Cite OEIS|A057588|name=Kummer numbers: -1 + product of first n consecutive primes}}</ref><ref>{{citation|title=The Call of the Primes: Surprising Patterns, Peculiar Puzzles, and Other Marvels of Mathematics|first=Owen|last=O'Shea|publisher=Prometheus Books|year=2016|isbn=9781633881488|page=44|url=https://books.google.com/books?id=xgIdDgAAQBAJ&pg=PA44}}</ref> One standard proof of [[Euclid's theorem]] that there are infinitely many primes uses the Kummer numbers, by observing that the prime factors of any Kummer number must be distinct from the primes in its product formula as a Kummer number. However, the Kummer numbers are not all prime, and as a [[semiprime]] (the product of two smaller prime numbers {{nowrap|1=11 × 19}}), 209 is the first example of a composite Kummer number.<ref>{{Cite OEIS|A125549|name=Composite Kummer numbers}}</ref>

