'''217''' ('''two hundred [and] seventeen''') is the [[natural number]] following [[216 (number)|216]] and preceding [[218 (number)|218]].

217 is a [[centered hexagonal number]], a [[polygonal number|12-gonal number]], a [[centered polygonal number|centered 36-gonal number]], a [[Fermat pseudoprime]] to [[base 5]], and a [[Blum integer]].<ref>[http://www.virtuescience.com/217.html The Number 217], Virtue Science</ref> It is both the sum of two positive cubes and the difference of two positive consecutive cubes in exactly one way: <math>217 = 6^3 + 1^3 = 9^3 - 8^3</math>. When written in binary, it is a non-repetitive [[Kaprekar number]].<ref>[http://oeis.org/A163205 The non-repetitive Kaprekar binary numbers in decimal], OEIS</ref> It is also the sum of all the [[divisor]]s of {{num|100}}.

